void updateScreen() {
	//take the game mem and convert it to vram
	ScreenUpdateCube = 0;
	while (ScreenUpdateCube != 16) {
		getXY();
		if (game[ScreenUpdateCube] == 2) {
			VRAM_CopySprite(cube2,x,y,36,36);
		} else if (game[ScreenUpdateCube] == 4) {
			VRAM_CopySprite(cube4,x,y,36,36);
		} else if (game[ScreenUpdateCube] == 8) {
			VRAM_CopySprite(cube8,x,y,36,36);
		} else if (game[ScreenUpdateCube] == 16) {
			VRAM_CopySprite(cube16,x,y,36,36);
		} else if (game[ScreenUpdateCube] == 32) {
			VRAM_CopySprite(cube32,x,y,36,36);
		} else if (game[ScreenUpdateCube] == 64) {
			VRAM_CopySprite(cube64,x,y,36,36);
		} else if (game[ScreenUpdateCube] == 128) {
			VRAM_CopySprite(cube128,x,y,36,36);
		} else if (game[ScreenUpdateCube] == 256) {
			VRAM_CopySprite(cube256,x,y,36,36);
		} else if (game[ScreenUpdateCube] == 512) {
			VRAM_CopySprite(cube512,x,y,36,36);
		} else if (game[ScreenUpdateCube] == 1024) {
			VRAM_CopySprite(cube1024,x,y,36,36);
		} else if (game[ScreenUpdateCube] == 2048) {
			VRAM_CopySprite(cube2048,x,y,36,36);
			//you win the game
		} else {
			VRAM_CopySprite(cube0,x,y,36,36);
		}

		ScreenUpdateCube = ScreenUpdateCube + 1;
	}
}

void createCube() {
	int CubeCreated = 1;
	int CubeCreatedTestTime = 0;
	int cube = (int)((float)rand()*16/(32768+1));
	int size = (int)((float)rand()*10/(32768+1));

	if (size == 0) {
		size = 4;
	} else {
		size = 2;
	}

	while (CubeCreated) {
		if (CubeCreatedTestTime == 16) {
			//gameover
			CubeCreated = 0;
		}

		if (game[cube] == 0) {
			game[cube] = size;
			CubeCreated = 0;
		} else {
			if (cube == 15) {
				cube = 0;
			} else {
				cube = cube + 1;
			}

			CubeCreatedTestTime = CubeCreatedTestTime + 1;
		}
	}
}

void moveUp() {
	int up = 0;

	while (up != 4) {
		//test first block
		if (game[0 + up] == game[4 + up]) {
			game[0 + up] = game[0 + up]*2;
			game[4 + up] = 0;
		} else if (game[0 + up] == 0) {
			game[0 + up] = game[4 + up];
			game[4 + up] = 0;
		}

		//test second block
		if (game[4 + up] == game[8 + up]) {
			game[4 + up] = game[4 + up]*2;
			game[8 + up] = 0;
		} else if (game[4 + up] == 0) {
			if (game[0 + up] == game[8 + up]) {
				game[0 + up] = game[0 + up]*2;
				game[8 + up] = 0;
			} else if (game[0 + up] == 0) {
				game[0 + up] = game[8 + up];
				game[8 + up] = 0;
			} else {
				game[4 + up] = game[8 + up];
				game[8 + up] = 0;
			}
		}

		//test last block
		if (game[8 + up] == game[12 + up]) {
			game[8 + up] = game[8 + up]*2;
			game[12 + up] = 0;
		} else if (game[8 + up] == 0) {
			if (game[4 + up] == game[12 + up]) {
				game[4 + up] = game[4 + up]*2;
				game[12 + up] = 0;
			} else if (game[4 + up] == 0) {
				if (game[0 + up] == game[12 + up]) {
					game[0 + up] = game[0 + up]*2;
					game[12 + up] = 0;
				} else if (game[0 + up] == 0) {
					game[0 + up] = game[12 + up];
					game[12 + up] = 0;
				} else {
					game[4 + up] = game[12 + up];
					game[12 + up] = 0;
				}
			} else {
				game[8 + up] = game[12 + up];
				game[12 + up] = 0;
			}
		}

		//move to next row
		up = up + 1;
	}
}

