void setup() {
	//set basic screen and random seed
	EnableStatusArea(3);
	Bdisp_EnableColor(1);
	VRAM_CopySprite(background,0,0,384,216);

	//set random int reneratior
	srand(RTC_GetTicks());

	//make random int and random pos for start cube's
	int cubesDone = 1;
	while (cubesDone) {
		int cube1 = (int)((float)rand()*16/(32768+1));
		int cube2 = (int)((float)rand()*16/(32768+1));
		int size = (int)((float)rand()*2/(32768+1));

		if (size == 0) {
			size = 2;
		} else {
			size = 4;
		}

		if (cube1 != cube2) {
			game[cube1] = 2;
			game[cube2] = size;

			cubesDone = 0;
		}
	}

	//update screen
	updateScreen();
}

void loop() {
	GetKey(&key);
	if (key == 30018) { //up
		moveUp();
		
		//update
		createCube();
		updateScreen();
	} else if (key == 30023) { //down
		moveDown();

		//update
		createCube();
		updateScreen();
	} else if (key == 30020) { //left
		moveLeft();

		//update
		createCube();
		updateScreen();
	} else if (key == 30021) { //right
		moveRight();

		//update
		createCube();
		updateScreen();
	} 
}

int main() {
	setup();

	while(1) {
		loop();
	}

	return 1;
}